import "./styles.css";
import {get} from "./axios";

export default function App() {
  get("artists/1/releases", "page=2&per_page=75")
  return (
    <div className="App">
      <h1>Hello CodeSandbox</h1>
      <h2>Start editing to see some magic happen!</h2>
    </div>
  );
}
